	(156, 'Operator', 1, 107, 0, 30, 20, 1, 'Tahun', '2025-09-26', '<ul>\r\n<li>Mengembangkan dan mengimplementasikan rencana strategis logistik untuk mengoptimalkan operasional dan mencapai tujuan bisnis.</li>\r\n<li>Mengawasi seluruh aspek operasional logistik.</li>\r\n<li>Mengelola dan mengoptimalkan proses logistik guna memastikan efisiensi dan efektivitas biaya.</li>\r\n<li>Merencanakan dan mengelola rute serta jadwal transportasi.</li>\r\n<li>Memilih dan mengelola penyedia transportasi (berbasis aset atau non-aset).</li>\r\n<li>Mengoptimalkan biaya transportasi dan memastikan pengiriman tepat waktu.</li>\r\n<li>Mengembangkan dan memantau indikator kinerja utama (KPI) untuk mengukur kinerja operasional.</li>\r\n<li>Menyiapkan dan menyajikan laporan rutin mengenai kinerja logistik.</li>\r\n<li>Memastikan kepatuhan terhadap semua regulasi transportasi dan standar keselamatan yang berlaku.</li>\r\n</ul>', '<ul>\r\n<li>Pendidikan minimal Sarjana (S1) dari segala jurusan.</li>\r\n<li>Minimal pengalaman kerja 8 - 10 tahun.</li>\r\n<li>Pengalaman kerja di industri serupa (preferably logistik).</li>\r\n<li>Memiliki pemahaman yang baik mengenai konsep dan implementasi&nbsp;3PL (Third Party Logistics)&nbsp;dan sistem&nbsp;Milkrun&nbsp;dalam proses distribusi dan logistik.</li>\r\n<li>Memiliki pemahaman mendalam tentang proses, model, dan strategi logistik serta rantai pasok secara menyeluruh.</li>\r\n<li>Memiliki motivasi tinggi dan keberanian dalam mengambil keputusan.</li>\r\n<li>Memiliki keterampilan analitis yang kuat untuk menginterpretasikan data logistik dan mengidentifikasi tren.</li>\r\n<li>Memiliki pengetahuan tentang regulasi transportasi dan standar keselamatan yang relevan.</li>\r\n<li>Berpengalaman dalam merencanakan, mengeksekusi, dan memonitor operasional logistik.</li>\r\n<li>Terampil dalam menggunakan Microsoft PowerPoint dan Excel.</li>\r\n<li>Memiliki keterampilan interpersonal yang luar biasa serta jiwa kepemimpinan yang kuat.</li>\r\n<li>Fasih dalam bahasa Inggris, baik secara lisan maupun tulisan, menjadi nilai tambah.</li>\r\n</ul>', 'ridwan.metallica@gmail.com', 0, '2025-09-24 17:50:08', '2025-09-24 17:50:08', NULL, NULL, NULL, NULL),
